member.summary:
        Characteristics of the input data stream for decoding.


        This enumeration allows to setup decoder in dependent-decoding (i.e. decodeEachMessageIndependently == false) mode for particular characteristics of the input data stream.



         The input data should contain only complete messages. This allows to perform decoding faster,
        but requires explicit call of Decoder.Reset() when someone error occurs or
        Decoder.Decode() returns NULL. Please note that Decoder.Decode() will fire exception if such reset was omitted after exception or NULL returned.



        This commonly prohibits usage of the mode for decoding streaming data like TCP/IP stream. On another hand the mode is highly recommended for the data distributed via
        UDP multicasting or other packet transport which requires reset of decoder at someone strongly determined points.



           Input data could contain partial messages. Decoding being performed bitly slower then in case of  but could be used
          for stream data decoding using following method:

Decoder decoder = new Decoder(templates, dictionary, false, InputDataTraits.CouldContainPartialMessages);
...
Message message = null;
while(message == null) {
  /* consume some data */
  message = decoder.Decode(buffer, offset, count, out ref numberOfDecodedBytes);
}
